【商品説明】<br>ハイライトは今まで、パウダータイプが主流でした。パウダータイプは粉なので、時間がたつと、くずれたり顔を手で触ってしまったりした時には、顔の他の部分や首など体の至るところに粉が飛んでしまうということがありました。今回、クラブコスメチックスのトッピングスイーツクリームは、パウダータイプではなくクリームタイプにすることで、しっかりと肌に密着し、時間がたっても崩れることなくツヤが長持ちします。今年は目鼻立ちのはっきりしたハーフ顔が旬顔ですが、このトッピングクリームを部分的に使用して頂くだけで、ツヤと立体感が出て、すぐに旬の顔になることが出来ます。ポーチに入れて、持ち運びがしやすい大きさになっていますので、気軽に外出先でもメイク直しとしてつけて頂くことも出来ます。なりたい印象や仕上がり、チークの色味によってお選び下さい。ラズベリーグロッシーは、華やかで可愛らしい印象になれます。ピンク系のチークやお肌に透明感が欲しい方に。アプリコットグロッシーは上品で大人っぽい印象になれます。オレンジ系のチークの方や好感度ＵＰなナチュラル感が欲しい方にお勧めです。<br>使用方法用途など：<BR>ご使用方法<br>(1)ファンデーション等を肌に塗布したあと、指先に少量とります。<br>(2)ツヤを出したい部分にのせます。<br>(3)中指と薬指の腹でたたくように広げてなじませます。<br>お顔全体に使用してもギラギラしすぎず、嫌いなツヤが出ます。<br><br>成分：<BR>水、シクロペンタシロキサン、ＢＧ、グリセリン、ジメチコン、トリメチルシロキシケイ酸、（ジメチコン／（ＰＥＧ－１０／１５））クロスポリマー、塩化Ｎａ、ＰＥＧ－９ジメチコン、ポリメタクリル酸メチル、（ジメチコン／ビニルジメチコン）クロスポリマー、フェノキシエタノール、メチルパラベン、エチルパラベン、トコフェロール、合成サファイア、ハチミツ、キイチゴエキス、（＋／－）タルク、マイカ、合成フルオロフロゴパイト、酸化チタン、酸化鉄、メチコン、シリカ、水酸化Ａｌ、ハイドロゲンジメチコン<br>使用上の注意：<BR>●傷やはれもの、湿疹など、お肌に異常がある時はお使いにならないでください。また、使用中、赤み・はれ・かゆみ・刺激等の異常があらわれた場合は使用を中止し、皮フ科専門医などにご相談ください。続けてお使いになると症状を悪化させることがあります。●目に入った時は直ちに洗い流してください。<br>●使用後は必ずしっかりとふたを閉めてください。<br>応急処置：<BR>目に入ったときは直ちに洗い流してください。<br>保管保存方法：<BR>使用後は必ずしっかりとふたを閉めてください。<br>保管および取扱い上の注意：<BR>●乳幼児の手の届かないところに保管してください。●極端に高温または低温の場所、直射日光のあたる場所には保管しないでください。<br>問い合わせ先：<BR>株式会社クラブコスメチックス 〒550-0005 大阪府大阪市西区西本町２－６－１１ お客様相談窓口　0120-16-0070 ９：００～１７：００（土日祝、年末年始、弊社休業日をのぞく）<br>原産国：日本<br>ブランド：<BR>商品サイズ：85×100×26<br>JANコード：4901416175435<BR>cs：48<BR>商品カテゴリ： 化粧品・化粧小物 ＞ メイクアップ ＞ チーク　(040206)<BR><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
